package a4;

public class PositionImpl implements Position {

	private int x;
	private int y;

	public PositionImpl(int x, int y) {
		this.x =x;
		this.y =y;
	}
	@Override
	public int getX() {
		// TODO Auto-generated method stub
		return x;
	}
	@Override
	public int getY() {
		// TODO Auto-generated method stub
		return y;
	}
	
	
}
